We may or may not be working with @dissentoffroad on something pretty epic for the 5th Gen 4Runner…. Something the 4Runner community has been wanting for a long time now… 

If you’re familiar with their Land Cruiser rear bumper line… you’re going to love what’s coming up for our 5th Gens. 

I’ve seen quite a few Dissent rear bumpers and always wondered what a 5th Gen version would look like…. Well, that day might actually come sooner than later. 😅

