Credit to @kansascity_cruiser and @adventuremotorskc. Just sit back and admire the work of art the @dissentoffroad dual swing bumper is. 

I have never been more impressed by a rear swing arm design.  It’s bolt on, super easy to open, and my favorite thing about them is the latch system while closing them.  Just push to close. #easypeasy 

