@trd_sequoia drove all the way from Texas to get his new Sequoia decked out with Dissent bumpers, tire swingout, and overland panel with jack door. He stepped it up a bit further with Rigid Industries lighting,  a ComeUp Solo 12.5rs winch with Agency6 shackle, switched with a SwitchPros SP9100 panel! This thing is hot! Give Eric a 👍 or 🤘in the comments so he has something to read during rest stops on his long drive home! 😂

If you want to upgrade your 3rd Gen Sequoia, give us a call or shoot us an email. We are currently only selling the bumpers for in-house installs, and the schedule is filling up fast. 

